<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Champions Trophy Live</title>
    <style>
        body {
            background-color: #121212;
            color: white;
            font-family: Arial, sans-serif;
            text-align: center;
        }
        .logo {
            display: block;
            margin: 15px auto;
            width: 150px;
        }
        @media (max-width: 768px) {
            .logo {
                width: 120px;
            }
        }
        .iframe-container {
            width: 80vw;
            max-width: 960px;
            height: calc((80vw * 9) / 16);
            max-height: 540px;
            border-radius: 5px;
            margin: 20px auto;
            background-color: #222;
        }
        @media (max-width: 768px) {
            .iframe-container {
                width: 95vw;
                height: calc((95vw * 9) / 16);
            }
        }
        .dropdown-container {
            margin: 10px auto;
        }
        select {
            padding: 10px;
            font-size: 16px;
            border-radius: 5px;
            border: none;
        }
        h1 {
            font-size: 20px;
            text-align: left;
            margin-left: 10px;
        }
        h2 {
            font-size: 16px;
            font-weight: normal;
            text-align: left;
            margin-left: 10px;
            color: #bbbbbb;
        }
        
            .match-box {
        display: flex;
        gap: 10px;
        align-items: center;
        justify-content: center;
        padding: 10px;
        flex-wrap: wrap;
        border: 1px solid white;
        border-radius: 7px;
        width: fit-content;
        margin: auto;
    }
    .team-flag {
        width: 20vw;
        max-width: 100px;
        height: auto;
        border-radius: 7px;
        border: 1px solid white;
    }
    .vs-text {
        font-size: 5vw;
        font-weight: bold;
        color: white;
    }
    @media (max-width: 600px) {
        .team-flag {
            width: 25vw;
        }
        .vs-text {
            font-size: 7vw;
        }
    }
    
                    /* Telegram Button Container */
        .telegram-container {
            text-align: center;
            margin: 30px 0;
        }

        /* Telegram Button Styling */
        .tg-button {
            display: inline-flex;
            align-items: center;
            justify-content: center;
            padding: 12px 25px;
            font-size: 18px;
            font-weight: bold;
            color: white;
            background-color: #0088cc; /* Telegram blue */
            border: none;
            border-radius: 50px; /* 50% rounded corners */
            text-decoration: none;
            box-shadow: 0 4px 6px rgba(0, 136, 204, 0.4);
            transition: all 0.3s ease;
        }

        .tg-button:hover {
            background-color: #0077b5; /* Slightly darker blue on hover */
            box-shadow: 0 6px 12px rgba(0, 136, 204, 0.6);
            transform: translateY(-2px); /* Lift button slightly on hover */
        }

        /* Telegram Logo in Button */
        .tg-button img {
            width: 24px;
            height: 24px;
            margin-right: 10px;
        }
    </style>
</head>
<body>
    <img src="https://i.ibb.co/S4HnkSpt/2025-ICC-Men-s-Champions-Trophy-Logo-svg.png" alt="Champions Trophy Logo" class="logo">
    <div class="iframe-container" id="iframeContainer"></div>
    <h1 id="match-title">Loading match data...</h1>
    <h2 id="match-subtitle"></h2>
    
    <div class="dropdown-container">
        <select id="channelDropdown"></select>
<br><br><br>
    <div id="upcoming-match" class="match-box"></div>
        </div>
        <div class="telegram-container">
        <a class="tg-button" href="https://t.me/axtream_bingewav" target="_blank">
            <img src="https://telegram.org/img/t_logo.png" alt="Telegram Logo">
            Bingehub
        </a>
    </div>
    </div>
        <div class="telegram-container">
        <a class="tg-button" href="https://t.me/cricketcliphd1" target="_blank">
            <img src="https://telegram.org/img/t_logo.png" alt="Telegram Logo">
            Cricket Clips
        </a>
    </div>

</div>
